import Link from 'next/link'
import Index from '../pages'
import styled from 'styled-components'

const NavContainer = styled.nav`
color: black;
`

const Nav = () => (
    <NavContainer>
        <ul>
            <li>Home</li>
            <li>About Me</li>
            <li>My Projects</li>
        </ul>
    </ NavContainer>
);

export default Nav;
